function Scanner() {
  return (
    <>
      <h1>Scanner</h1>
      <input
        type="file"
        accept="image/*"
        capture="environment"
        onChange={processFile}
      />
    </>
  );
}

const convertBase64 = (file: File) => {
  return new Promise((resolve, reject) => {
    const fileReader = new FileReader();
    fileReader.readAsDataURL(file);

    fileReader.onload = () => {
      resolve(fileReader.result);
    };

    fileReader.onerror = (error) => {
      reject(error);
    };
  });
};

const processFile = async (e: React.ChangeEvent<HTMLInputElement>) => {
  const file = e.target.files![0];

  // Convert to base64 string
  const base64 = await convertBase64(file);

  const data = new FormData();
  data.append("refresh", "false");
  data.append("incognito", "false");
  data.append("extractTime", "false");
  data.append("extractLineItems", "true");
  data.append(
    "file",
    "data:image/jpeg;name=test.jpg;base64,"
  );

  const xhr = new XMLHttpRequest();
  xhr.withCredentials = true;

  xhr.addEventListener("readystatechange", function () {
    if (this.readyState === this.DONE) {
      console.log(this.responseText);
    }
  });

  xhr.open("POST", "https://api.taggun.io/api/receipt/v1/verbose/file");
  xhr.setRequestHeader("accept", "application/json");
  xhr.setRequestHeader("apikey", "e103af406b4311eea8f313266e4aecd5");

  xhr.send(data);
};

export default Scanner;
